import React from "react";
import Map from "./Map";
import QuadFeature from "./QuadFeature";
import { Lead } from "./Lead";

const Hero = () => {
  return (
    <>
      <Lead />
      <Map />
      <QuadFeature />
    </>
  );
};

export default Hero;
